'use strict';

var isArrayArray = require( './../lib' );

var bool = isArrayArray( [ [], [], [] ] );
console.log( bool );
// => true

bool = isArrayArray( [ [], {} ] );
console.log( bool );
// => false

bool = isArrayArray( [] );
console.log( bool );
// => false

bool = isArrayArray( {} );
console.log( bool );
// => false

bool = isArrayArray( [ 'a', 'b' ] );
console.log( bool );
// => false

bool = isArrayArray( null );
console.log( bool );
// => false
